import React, { useState, useEffect } from 'react';
import './App.css';
import TicketList from './components/TicketList';
import CreateTicket from './components/CreateTicket';
import TicketDetails from './components/TicketDetails';
import CategoryManagement from './components/CategoryManagement';
import PriorityManagement from './components/PriorityManagement';
import KnowledgeBaseManagement from './components/KnowledgeBaseManagement';
import UserManagement from './components/UserManagement';
import Login from './components/Login';
import Signup from './components/Signup';
import AdminPortal from './components/AdminPortal';
import UserPortal from './components/UserPortal';
import { BrowserRouter as Router, Routes, Route, NavLink, useNavigate, useParams, Navigate } from 'react-router-dom';

function App() {
  return (
    <Router>
      <nav style={{background: 'var(--accent)', padding: '1rem 0', marginBottom: 24}}>
        <div className="container" style={{display: 'flex', justifyContent: 'space-between', alignItems: 'center'}}>
          <span style={{color: '#fff', fontWeight: 600, fontSize: '1.3rem', letterSpacing: '0.08em'}}>Help Desk Ticketing System</span>
          <div>
            <NavLink
              to="/"
              end
              className={({ isActive }) => isActive ? 'btn-primary' : 'btn-secondary'}
              style={{marginRight: 8}}
            >
              All Tickets
            </NavLink>
            <NavLink
              to="/create"
              className={({ isActive }) => isActive ? 'btn-primary' : 'btn-secondary'}
              style={{marginRight: 8}}
            >
              Create Ticket
            </NavLink>
            <NavLink
              to="/categories"
              className={({ isActive }) => isActive ? 'btn-primary' : 'btn-secondary'}
              style={{marginRight: 8}}
            >
              Categories
            </NavLink>
            <NavLink
              to="/priorities"
              className={({ isActive }) => isActive ? 'btn-primary' : 'btn-secondary'}
              style={{marginRight: 8}}
            >
              Priorities
            </NavLink>
            <NavLink
              to="/knowledge-base"
              className={({ isActive }) => isActive ? 'btn-primary' : 'btn-secondary'}
              style={{marginRight: 8}}
            >
              Knowledge Base
            </NavLink>
            <NavLink
              to="/users"
              className={({ isActive }) => isActive ? 'btn-primary' : 'btn-secondary'}
            >
              Users
            </NavLink>
          </div>
        </div>
      </nav>
      <main>
        <Routes>
          <Route path="/" element={<TicketListWrapper />} />
          <Route path="/create" element={<CreateTicketWrapper />} />
          <Route path="/tickets/:id" element={<TicketDetailsWrapper />} />
          <Route path="/categories" element={<CategoryManagement />} />
          <Route path="/priorities" element={<PriorityManagement />} />
          <Route path="/knowledge-base" element={<KnowledgeBaseManagement />} />
          <Route path="/users" element={<UserManagement />} />
        </Routes>
      </main>
    </Router>
  );
}

//--- Routing-aware wrappers to handle navigation between details/list ---//
function TicketListWrapper() {
  const navigate = useNavigate();
  return <TicketList onViewDetails={id => navigate(`/tickets/${id}`)} />;
}

function CreateTicketWrapper() {
  const navigate = useNavigate();
  return (
    <CreateTicket onSuccess={ticket => ticket?.id && navigate(`/tickets/${ticket.id}`)} />
  );
}

function TicketDetailsWrapper() {
  const { id } = useParams();
  const navigate = useNavigate();
  const ticketId = Number(id);
  return <TicketDetails ticketId={ticketId} onStatusUpdate={() => {}} onBack={() => navigate('/')} />;
}

export default App;
